#include <mex.h>


void print_usage() {
    mexPrintf("c = compute_coefficients_H25lvk_det_14x18(data)\n");
    mexPrintf(" where data = [x1;xp1;x2;xp2;x3;xp3] is a 12x1 vector.\n");
}

void compute_coeffs(double* coeffs);

void mexFunction(int nlhs, mxArray *plhs[], int nrhs, const mxArray *prhs[])
{
    if(nrhs != 1 || nlhs != 1) {
        print_usage();
        return;
    }
    
    // output matrix
    plhs[0] = mxCreateDoubleMatrix(320,1,mxREAL);
    double *coeffs = mxGetPr(plhs[0]);
        
    // make sure input is correct size
    if(mxGetM(prhs[0]) != 12 || mxGetN(prhs[0]) != 1) {
        print_usage();
        return;
    }
    
    // get pointers
    double *u = mxGetPr(prhs[0]);
    
    for(int i = 0; i < 12; i++)
        coeffs[i] = u[i];
    
    compute_coeffs(coeffs);
}


